import './App.css';
import Header from './components/Header'

const Body: React.FC = () => {
  return <>
    <div>
      <button className='btn btn-info'>Add Review</button>
    </div>
    <div className='col'>
      <input className='searchName' type="text" placeholder='Search...'/>
      <span>Sort by time</span> | <span>Sort by rate</span>
    </div>
    {/* <h1 className='color-blue'>Hello Function</h1>
    <p>airong...</p>
    <img src="/logo512.png" alt="" srcSet="" /> */}
  </>
}

const App: React.FC = () => {
  return <div className='body'>
    <Header />
    <Body />
  </div>
}

export default App;
